import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import bgImage from './assets/bg.jpg';
import AboutMe from './about-me';


function Home() {
  return (
    <>
      <Navbar bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="#ahmad-numan">Ahmad Numan</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#">Aboutme</Nav.Link>
            <Nav.Link href="#about">About</Nav.Link>
            <Nav.Link href="#contact">Contact</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
      <div className="Home">
        <Container>
          <img src={bgImage} alt="Background" style={{ width: '100%', height: 'auto' }} />
        </Container>
      </div>
      <br />
      <br />


      <footer className="text-center mt-4 mb-4 dark">
        &copy; {new Date().getFullYear()} Ahmad Numan. All rights reserved.
      </footer>
    </>
  );
}

export default Home;
